// src/pages/ExpenseTracker.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Pie, Line } from 'react-chartjs-2';
import { Chart, registerables } from 'chart.js'; // Import Chart and registerables

// Register the components required for the charts
Chart.register(...registerables);

const ExpenseTracker = () => {
  const [expenses, setExpenses] = useState([]);
  const [categories, setCategories] = useState(['Food', 'Transport', 'Accommodation', 'Entertainment', 'Others']);
  const [limits, setLimits] = useState({});
  const [newExpense, setNewExpense] = useState("");
  const [suggestions, setSuggestions] = useState([]);

  // Fetch expenses and suggestions on mount
  useEffect(() => {
    fetchExpenses();
    fetchSuggestions();
  }, []);

  const fetchExpenses = async () => {
    try {
      const response = await axios.get('/api/expenses');
      setExpenses(response.data);
    } catch (error) {
      console.error('Error fetching expenses:', error);
    }
  };

  const fetchSuggestions = async () => {
    try {
      const response = await axios.get('/api/expenses/suggestions');
      setSuggestions(response.data);
    } catch (error) {
      console.error('Error fetching suggestions:', error);
    }
  };

  const handleLimitChange = (e) => {
    setLimits({ ...limits, [e.target.name]: e.target.value });
  };

  const handleExpenseSubmit = async (e) => {
    e.preventDefault();
    const amount = parseFloat(newExpense.match(/(\d+(\.\d+)?)/)[0]);
    const category = newExpense.split(' ')[2] || 'Others'; // Basic categorization

    try {
      await axios.post('/api/expenses', { description: newExpense, amount, category });
      setNewExpense('');
      fetchExpenses();
      fetchSuggestions(); // Fetch new suggestions after adding expense
    } catch (error) {
      console.error('Error adding expense:', error);
    }
  };

  // Prepare data for charts
  const getCategoryData = () => {
    const categoryData = {};
    expenses.forEach(exp => {
      const cat = exp.category || "Others";
      categoryData[cat] = (categoryData[cat] || 0) + exp.amount;
    });
    return {
      labels: Object.keys(categoryData),
      datasets: [{
        data: Object.values(categoryData),
        backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56', '#4BC0C0', '#9966FF'],
      }],
    };
  };

  const getTrendData = () => {
    const trendData = {};
    expenses.forEach(exp => {
      const date = new Date(exp.date).toLocaleDateString();
      trendData[date] = (trendData[date] || 0) + exp.amount;
    });
    return {
      labels: Object.keys(trendData),
      datasets: [{
        label: 'Spending Trend',
        data: Object.values(trendData),
        fill: false,
        borderColor: '#36A2EB',
      }],
    };
  };

  return (
    <div className="container">
      <h1 className="my-4">Expense Tracker</h1>
      <div className="mb-4">
        <h2>Set Spending Limits</h2>
        {categories.map(category => (
          <div key={category} className="mb-2">
            <label>{category}: </label>
            <input
              type="number"
              name={category}
              value={limits[category] || ''}
              onChange={handleLimitChange}
              className="form-control"
            />
          </div>
        ))}
      </div>

      <div className="mb-4">
        <h2>Add Expense</h2>
        <form onSubmit={handleExpenseSubmit}>
          <input
            type="text"
            placeholder="Description (e.g., Spent $20 on lunch)"
            value={newExpense}
            onChange={(e) => setNewExpense(e.target.value)}
            required
            className="form-control"
          />
          <button type="submit" className="btn btn-primary mt-2">Add Expense</button>
        </form>
      </div>

      <div className="mb-4">
        <h2>Category-wise Breakdown</h2>
        <Pie data={getCategoryData()} />
      </div>

      <div className="mb-4">
        <h2>Spending Trend</h2>
        <Line data={getTrendData()} />
      </div>

      <div className="mb-4">
        <h2>Suggestions for Saving</h2>
        <ul>
          {suggestions.map((suggestion, index) => (
            <li key={index}>{suggestion}</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default ExpenseTracker;
